Чарующая природа и развлечения на любой вкус

Статус архипелага как места отдыха «богатых и знаменитых» обеспечил прочный спрос и стабильные цены на сервис высокого качества.

Местные власти активно поощряют и стимулируют развитие элитного туризма. Достижению этой цели подчинено формирование соответствующей инфраструктуры, индустрии развлечений и системы сервиса высочайшего уровня.

Безупречное качество услуг – основа нашей репутации

Мы готовы обеспечить вам безмятежный комфорт с момента приезда:

    трансфер и сопровождающего, охрану и переводчика;
    службу качественного сервиса, ухода за жилищем, организация и кейтеринг праздников;
    аренду автомобиля, яхты класса «премиум»;
    резервацию абонементов в клубы, столиков, билетов на светские и увеселительные мероприяти
